import React from 'react';
import './home.css';
import { Link } from 'react-router-dom';

const Home = () => {

    return (

        <div>
            <h1>Home</h1>

            {/* botão para ir para a página de registro */}
            <Link to="/register">
                <button>Register</button>
            </Link>

        </div>

    );
};

export default Home;
